import styled from "styled-components";

const MainDiv = styled.div``;
const LeftDiv = styled.div``;
const RightDiv = styled.div``;

const Home = () => {
  return (
    <MainDiv>
      <LeftDiv>
        <h1>Find Your Dream Remote Job In One Place</h1>
      </LeftDiv>
      <RightDiv></RightDiv>
    </MainDiv>
  );
};

export default Home;
